			n2 += w2*d2;
			n1 *= s1;
			n2 *= s2;

			n3 = n1*d2+n2*d1;
			d3 = d1*d2;
			n_sign = d_sign = 1;
			if( n3<0 ) {n_sign=-1; n3=-n3; }
			if( d3<0 ) {d_sign=-1; d3=-d3; }
			g = gcd(n3,d3);
			n3/=g;
			d3/=g;
			sn3 = n_sign*n3;
			sd3 = d_sign*d3;
			out1 = sn3+'/'+sd3;
			if( n3 > d3 ) {
				i = Math.floor(n3/d3);
				j = n3-i*d3;
				if( j>0 ) {
					sign='';
					if( n_sign*d_sign==-1 ) sign = '-';
					out2 = sign+i+' '+j+'/'+d3;
				}
			}
			out3 = roundresult(n_sign*d_sign*n3/d3);
			if( out1!='' ) out1+=' = ';
			if( out2!='' ) out2+=' = ';
