         x[i] = 0;
      for(i=0; i<Nx; i++)
         x[i+Nh-1] = parseFloat(x1[i]);
      for(i=Nx+Nh-1; i<Nx+2*(Nh-1); i++)
         x[i] = 0;
      for(i=0; i<Nh; i++)
         h[i] = parseFloat(x2[i]);

      for(i=0; i<Ny; i++)
      {
         y[i] = 0;
         for(j=0; j<Nh; j++)
            y[i] += x[i+j]*h[Nh-1-j];
      }


      yy = '';
      for(i=0; i<Ny; i++) {
         yy+=String(y[i])+' ';

      }
      document.calcform.TA3.value = yy;

   }

