function fcalc() 
		{
			out1 = out2 = '';
			n = parseFraction(document.calcform.n1.value);
			var s1 = parseInt(n[0]);
			var w1 = parseInt(n[1]);
			var n1 = parseInt(n[2]);
			var d1 = parseInt(n[3]);
			n = parseFraction(document.calcform.n2.value);
			var s2 = parseInt(n[0]);
			var w2 = parseInt(n[1]);
			var n2 = parseInt(n[2]);
			var d2 = parseInt(n[3]);

			n1 += w1*d1;
			n2 += w2*d2;
			n1 *= s1;
			n2 *= s2;

			n3 = n1*n2;
			d3 = d1*d2;
			n_sign = d_sign = 1;
			if( n3<0 ) {n_sign=-1; n3=-n3; }
			if( d3<0 ) {d_sign=-1; d3=-d3; }
			g = gcd(n3,d3);
			n3/=g;
			d3/=g;
			sn3 = n_sign*n3;
			sd3 = d_sign*d3;
			out1 = sn3+'/'+sd3;
			if( n3 > d3 ) {
				i = Math.floor(n3/d3);
				j = n3-i*d3;
				if( j>0 ) {
					sign='';
					if( n_sign*d_sign==-1 ) sign = '-';
					out2 = sign+i+' '+j+'/'+d3;
				}
			}
			out3 = roundresult(n_sign*d_sign*n3/d3);
			if( out1!='' ) out1+=' = ';
			if( out2!='' ) out2+=' = ';
			document.calcform.out.value = out1+out2+out3;
		}

function calc0()
		{
			var a = document.calcform.a.value;
			var b = document.calcform.b.value;
			var out=a+":"+b;
			var int_a=(a==Math.round(a));
			var int_b=(b==Math.round(b));
			var g=1;
			if( int_a && int_b )
				g=gcd(a,b);
			if( (g!=1)&&((a/g)!=1)&&((b/g)!=1) )
				out+=" = "+(a/g)+":"+(b/g);
			if( a!=1 )
				out+=" = 1:"+(b/a);
			if( b!=1 )
				out+=" = "+(a/b)+":1";
			document.calcform.out.value = out;
		}

