      }
      return params;
   }

function roman2num(x)
   {
      x = x.replace(/\s/g, '');
      var xx=x;
      var d;
      var txt="",txt1="",txt2="",txt3="";
      x = x.toUpperCase();
      var y = 0;
      while( x.length>0 ) {
         d = getDigit(x);
         y += d[0];
         if( prev_d<d[0] )
            return [0, 0];
         prev_d=d[0];
         if( d[1]==0 )
            return 0;
         else if( d[1]==1 )
            x = x.substring(1, x.length);
         else if( d[1]==2 )
            x = x.substring(2, x.length);
         txt1+=d[2]+"+";
         txt2+=d[0]+"+";
      }
      txt1 = txt1.substring(0, txt1.length-1);
      txt2 = txt2.substring(0, txt2.length-1);
      if( xx==txt1 ) txt1="";
      else txt1=" =\n"+txt1;
      if( txt2==y ) txt2="";
      else txt2+=" =\n";
      txt = xx+txt1+" =\n"+txt2+y;
      txt = txt.toUpperCase();
      return [y, txt];
   }

